// SearchPage.js
import React, { useState, useEffect } from 'react';
import SongResults from './SongResults';
import AlbumResults from './AlbumResults';

function SearchPage({ playSong }) {
  const [searchTerm, setSearchTerm] = useState('');
  const [songResults, setSongResults] = useState([]);
  const [albumResults, setAlbumResults] = useState([]);
  const [selectedSong, setSelectedSong] = useState(null); // Track the selected song for details
  const [isPlaylistPopupOpen, setIsPlaylistPopupOpen] = useState(false); // Track if the playlist selection popup is open

  // Debounce function to delay the search request
  const debounce = (func, delay) => {
    let timeoutId;
    return function (...args) {
      if (timeoutId) {
        clearTimeout(timeoutId);
      }
      timeoutId = setTimeout(() => {
        func(...args);
      }, delay);
    };
  };

  // Perform the search when the searchTerm changes, debounced with a delay of 300 milliseconds
  const debouncedSearch = debounce(async (term) => {
    if (term.trim() === '') {
      setSongResults([]); // Clear song results if the search term is empty
      setAlbumResults([]); // Clear album results if the search term is empty
      return;
    }

    try {
      const response = await fetch(`http://localhost:3002/api/search?q=${encodeURIComponent(term)}`);
      const data = await response.json();
      console.log(data);

      // Assuming data is an array of results containing both songs and albums
      setSongResults(data.filter((item) => item.type === 'song'));
      setAlbumResults(data.filter((item) => item.type === 'album'));
    } catch (error) {
      console.error(error);
    }
  }, 300);

  // useEffect to trigger the debounced search when searchTerm changes
  useEffect(() => {
    debouncedSearch(searchTerm);
  }, [searchTerm, debouncedSearch]);

  // Handler to open the details for a selected song
  const handleOpenDetails = (song) => {
    setSelectedSong(song);
  };

  // Handler to close the details
  const handleCloseDetails = () => {
    setSelectedSong(null);
  };

  // Handler to open the playlist selection popup
  const handleOpenPlaylistPopup = () => {
    setIsPlaylistPopupOpen(true);
  };

  // Handler to close the playlist selection popup
  const handleClosePlaylistPopup = () => {
    setIsPlaylistPopupOpen(false);
  };

  // Dummy function to simulate adding the selected song to a playlist
  const handleAddToPlaylist = (playlist) => {
    console.log(`Adding song to playlist: ${playlist.name}`);
    handleClosePlaylistPopup();
  };

  return (
    <div>
      <h1>Music Search</h1>
      <input
        type="text"
        placeholder="Search for songs or albums"
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />

      {/* Display song results with details and options */}
      <div>
        {songResults.map((song) => (
          <div key={song.id}>
            <h3>{song.name}</h3>
            <p>{song.artist}</p>
            {/* Add other song details here */}
            <button onClick={() => handleOpenDetails(song)}>More Details</button>
            <button onClick={handleOpenPlaylistPopup}>Add to Playlist</button>
            {selectedSong && selectedSong.id === song.id && (
              <div>
                {/* Display options for the selected song */}
                <p>Option 1</p>
                <p>Option 2</p>
                <button onClick={handleCloseDetails}>Close Details</button>
              </div>
            )}
          </div>
        ))}
      </div>

      {/* Display the playlist selection popup */}
      {isPlaylistPopupOpen && (
        <div>
          <h2>Select Playlist</h2>
          {/* Fetch and display the user's playlists */}
          {/* Implement logic to fetch and display user's playlists */}
          {/* For simplicity, you can mock the playlists */}
          <ul>
            <li onClick={() => handleAddToPlaylist({ name: 'Playlist 1' })}>Playlist 1</li>
            <li onClick={() => handleAddToPlaylist({ name: 'Playlist 2' })}>Playlist 2</li>
            {/* Add more playlists here */}
          </ul>
          <button onClick={handleClosePlaylistPopup}>Cancel</button>
        </div>
      )}

      {/* Use the AlbumResults component for albums */}
      <AlbumResults results={albumResults} />
    </div>
  );
}

export default SearchPage;
